import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import BootStrapNavbar from './components/Navbar/BootStrapNavbar';


ReactDOM.render(
  <React.StrictMode>
    <BootStrapNavbar/>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
